// SET UP EVENT LISTENERS

const cells = document.querySelectorAll("img");
const h2 = document.querySelector("h2");
const h1 = document.querySelector("h1");
const body = document.querySelector("body");
let pokeBallUrl =
  "data:image/png;base64,";

cells.forEach((cell) => {
  cell.setAttribute("src", pokeBallUrl);
});

cells.forEach((cell) => {
  cell.addEventListener("click", () => {
    // GET URL
    const url = pokemonUrls[getRanIdx(pokemonUrls)];
    console.log(url);

    // GET POKEMON NAME
    let pokeName = url.split("/").slice(-1);
    pokeName = pokeName[0].split(".")[0].toLocaleUpperCase();
    h2.innerText = pokeName;

    cell.setAttribute("src", url);
    console.log(url);
  });
});

cells.forEach((cell) => {
  cell.addEventListener("mouseover", () => {
    console.log("Youre mouse is hovering");
    cell.classList.add("colorHover");
  });
});

cells.forEach((cell) => {
  cell.addEventListener("mouseleave", () => {
    cell.classList.remove("colorHover");
  });
});

h1.addEventListener("mousedown", () => {
  console.log("click");
  h1.classList.add("emphasis");
});

h1.addEventListener("mouseup", () => {
  h1.classList.remove("emphasis");
});

h2.addEventListener("mousedown", () => {
  console.log("click");
  h2.classList.add("emphasis");
});

h2.addEventListener("mouseup", () => {
  h2.classList.remove("emphasis");
});

const container = document.querySelector(".container");

container.addEventListener("mouseenter", () => {
  container.classList.add("colorHover");
});

container.addEventListener("mouseleave", () => {
  container.classList.remove("colorHover");
});

h1.addEventListener("click", () => {
  cells.forEach((cell) => {
    cell.setAttribute("src", pokeBallUrl);
    h2.innerText = "";
  });
});

body.addEventListener("keydown", (event) => {
  if (event.code === "Enter") {
    body.style.backgroundColor === ""
      ? (body.style.background = "#e3e3e3")
      : (body.style.background = "");
  }
});

